import React from 'react';
import NavBar from './components/NavBar';
import WelcomeBlock from './components/WelcomeBlock';
import AboutCourceBlock from './components/AboutCourceBlock';
import PhotoBaner from './components/PhotoBaner';
import BuyCourse from './components/BuyCourse';
import Caroucel from './components/Caroucel';
import Footer from './components/Footer';
import СourseContent from './components/СourseContent';

import './App.scss';
import 'shorthandcss/scss/shorthand.scss';
import ForWho from './components/ForWho';
import Card from './components/Card';
import Team from './components/Team';
import ContactMe from './components/ContactMe';
import CaseCard from './components/CaseCard';
import Login from './components/Login';

import { login } from './utils/near';

function App() {
  const loginInfo = window.walletConnection.account();

  return (
    <>
      {!loginInfo.accountId ? (
        <Login login={() => login()} />
      ) : (
        <>
          <NavBar />
          <WelcomeBlock />
          <AboutCourceBlock />
          <СourseContent />
          <PhotoBaner />
          <BuyCourse />
          <Caroucel />
          <ForWho />
          <Card />
          <Team />
          <CaseCard />
          <ContactMe />
          <Footer />
        </>
      )}
    </>
  );
}

export default App;
